{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/marquesigor/portuguese-housing-market-capstone-project?scriptVersionId=249751792\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"a6fb5903","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","papermill":{"duration":0.003975,"end_time":"2025-07-10T08:56:34.434247","exception":false,"start_time":"2025-07-10T08:56:34.430272","status":"completed"},"tags":[]},"source":["**1. 🧠 Introduction**\n","\n","This notebook is part of the final Capstone Project (Track B) for the [Google Data Analytics Professional Certificate](https://www.coursera.org/professional-certificates/google-data-analytics).\n","\n","The project originated from a very real and personal question: *\"Can I actually afford a home in Portugal?\"* (spoiler: not really). From this starting point, I decided to investigate housing prices using data from Idealista, and later expand into macroeconomic indicators to better understand trends in affordability and housing accessibility across Portugal.\n","\n","This notebook is **iterative by design** and will be updated as more data is added (INE, BdP, migration, wages, etc). All data cleaning was done in R and is available on GitHub.\n","\n","🔗 [GitHub Repository](https://github.com/igor-marques/portugal-housing-market-capstone)\n","\n","⚠️ *Note: LLMs (ChatGPT and Manus.IM) were consulted during development.*"]},{"cell_type":"markdown","id":"b81e119a","metadata":{"papermill":{"duration":0.003074,"end_time":"2025-07-10T08:56:34.44069","exception":false,"start_time":"2025-07-10T08:56:34.437616","status":"completed"},"tags":[]},"source":["**2. 📁 Data Preparation**\n","\n","*2.1 Idealista Data*\n","Initial data source: cleaned Idealista price records for sale and rental housing across Portuguese regions (including archipelagos, later consolidated).\n","- Cleaned using R scripts\n","- Uploaded as long-format CSV: `idealista_prices_consolidated.csv`\n","- Dates range: ~2015 to early 2025\n","\n","*2.2 Other Sources (Planned)*\n","- INE: minimum/average wages, new construction, household size\n","- Banco de Portugal: interest rates, lending trends\n","- Migration data: internal and international"]},{"cell_type":"code","execution_count":1,"id":"f4e11d9c","metadata":{"execution":{"iopub.execute_input":"2025-07-10T08:56:34.452069Z","iopub.status.busy":"2025-07-10T08:56:34.449615Z","iopub.status.idle":"2025-07-10T08:56:35.7626Z","shell.execute_reply":"2025-07-10T08:56:35.760422Z"},"papermill":{"duration":1.321177,"end_time":"2025-07-10T08:56:35.764956","exception":false,"start_time":"2025-07-10T08:56:34.443779","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘dplyr’\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n"]},{"name":"stderr","output_type":"stream","text":["\u001b[1mRows: \u001b[22m\u001b[34m4638\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m5\u001b[39m\n"]},{"name":"stderr","output_type":"stream","text":["\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (2): region, price_type\n","\u001b[32mdbl\u001b[39m  (2): price_per_sqm, n_regions\n","\u001b[34mdate\u001b[39m (1): date\n"]},{"name":"stderr","output_type":"stream","text":["\n","\u001b[36mℹ\u001b[39m Use `spec()` to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Spec