.width = 15, repr.plot.height = 10)\n","\n","# Compute index relative to first point per price type\n","base_index <- idealista_data %>%\n","  filter(region == \"portugal\") %>%\n","  group_by(price_type) %>%\n","  mutate(index = price_per_sqm / first(price_per_sqm) * 100)\n","\n","# Plot indexed evolution\n","ggplot(base_index, aes(x = date, y = index, color = price_type)) +\n","  geom_line(size = 1.2) +\n","  labs(\n","    title = \"Housing Price Evolution in Portugal (Index: Jan 2015 = 100)\",\n","    y = \"Index\", x = NULL,\n","    color = \"Type\"\n","  ) +\n","  theme_minimal(base_size = 20)"]},{"cell_type":"markdown","id":"c4ec5078","metadata":{"papermill":{"duration":0.010507,"end_time":"2025-07-10T08:56:37.728431","exception":false,"start_time":"2025-07-10T08:56:37.717924","status":"completed"},"tags":[]},"source":["The spike around early 2018 in the \"sale\" price index (and also slightly mirrored in rentals) likely indicates a data artifact, possibly due to:\n","\n","* Erroneous value(s) in Idealista listings for Portugal as a whole (e.g., a district or island temporarily reporting extreme values).\n","* Aggregation issue — maybe some smaller region had anomalously high prices and wasn’t properly diluted in the average.\n","* Scraping glitch — sometimes data pipelines pull erroneous values from listing platforms during updates.\n","* Outlier sale(s) — a few unusually expensive properties (e.g., luxury listings) might distort the average in smaller regions.\n","\n","These anomalies raise questions about the consistency of listing-based sources. To better understand if these spikes reflect real market trends or data artifacts, we will be incorporating official datasets from INE, Banco de Portugal, and others as the project progresses."]},{"cell_type":"markdown","id":"810ab22a","metadata":{"papermill":{"duration":0.011267,"end_time":"2025-07-10T08:56:37.749709","exception":false,"start_time":"2025-07-10T08:56:37.738442","status":"completed"},"tags":[]},"source":["**3.2 Correlation Between Regions and National Average**\n","\n","We can correlate each region’s trend with the national average. Regions with low correlation may behave differently from the overall trend — either lagging or diverging in dynamics.\n","\n","*3.2.1 Rentals*"]},{"cell_type":"code","execution_count":5,"id":"b80628ba","metadata":{"execution":{"iopub.execute_input":"2025-07-10T08:56:37.773573Z","iopub.status.busy":"2025-07-10T08:56:37.771931Z","iopub.status.idle":"2025-07-10T08:56:37.825427Z","shell.execute_reply":"2025-07-10T08:56:37.823637Z"},"papermill":{"duration":0.068066,"end_time":"2025-07-10T08:56:37.82777","exception":false,"start_time":"2025-07-10T08:56:37.759704","status":"completed"},"tags":[]},"outputs":[],"source":["library(dplyr)\n","library(tidyr)\n","library(ggplot2)\n","\n","# Choose price_type to analyze: 'rental' or 'sale'\n","price_type_filter <- \"rental\"\n","\n","# Filter data and pivot\n","regional_matrix <- idealista_data %>%\n","  filter(price_type == price_type_filter) %>%\n","  select(date, region, price_per_sqm) %>%\n","  pivot_wider(names_from = region, values_from = price_per_sqm)\n","\n","# Compute correlation matrix (ignoring rows with NA)\n","cor_matrix <- cor(regional_matrix %>% select(-date), use = \"pairwise.complete.obs\")\n","\n","# Extract correlation with 'portugal' column only\n","portugal_corr <- cor_matrix[\"portugal\", ]\n","portugal_corr_df <- data.frame(\n","  region = names(portugal_corr),\n","  correlation = as.numeric(portugal_corr)\n",") %>%\n","  filter(region != \"portugal\") %>%\n","  arrange(correlation)"]},{"cell_type":"code","execution_count":6,"id":"766a698f","metadata":{"execution":{"iopub.execute_input":"2025-07-10T08:56:37.851841Z","iopub.status.busy":"2025-07-10T08:56:37.85015Z","iopub.status.idle":"2025-07-10T08:56:38.150391Z","shell.execute_reply":"2025-07-10T08:56:38.148653Z"},"papermill":{"duration":0.315288,"end_time":"2025-07-10T08:56:38.153307","exception":false,"start_time":"202