AFSHwCgAAAAAAAAA1fl/Lp0Pe8i6ppUAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":600,"width":900}},"output_type":"display_data"}],"source":["ggplot(portugal_corr_df, aes(x = reorder(region, correlation), y = correlation)) +\n","  geom_col(fill = \"#0072B2\") +\n","  coord_flip() +\n","  labs(\n","    title = paste(\"Correlation with National Average (\", price_type_filter, \")\", sep = \"\"),\n","    x = \"Region\", y = \"Pearson Correlation\"\n","  ) +\n","  theme_minimal(base_size = 20)"]},{"cell_type":"markdown","id":"d0698883","metadata":{"papermill":{"duration":0.015167,"end_time":"2025-07-10T08:56:38.649045","exception":false,"start_time":"2025-07-10T08:56:38.633878","status":"completed"},"tags":[]},"source":["🧠 Insight: Regional Divergence in Sale Prices\n","When comparing how closely each region tracks the national average housing trend, we notice a key distinction:\n","\n","* Rental prices show a strong, consistent correlation across all regions, suggesting that rental markets in Portugal tend to move in unison — likely influenced by broad national socioeconomic factors (e.g. inflation, wage policies, or national demand trends).\n","* In contrast, sale prices display much more regional variability. Several regions — notably Portalegre, Castelo Branco, Beja, and Vila Real — show a weak correlation with the national average (*R²* < 0.75). This suggests that property sale markets are influenced by local dynamics such as:\n","1. regional employment and migration patterns,\n","2. urban development or depopulation trends,\n","3. local investment incentives or stagnation.\n","This discrepancy reinforces the importance of disaggregating the analysis when looking at housing purchase data — a national average might obscure relevant local market phenomena."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":7828255,"sourceId":12412541,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":false,"isInternetEnabled":true,"